import { addUser } from '../actions';

const INITIAL_STATE = {
  email: '',
};

const user = (state = INITIAL_STATE, action) => {
  switch (action.type) {
  case addUser:
    return {
      ...state,
      ...payload,
    };
  default:
    return state;
  }
};

export default user;
